Formula:
var conv = DIVIDE( COUNTX( FILTER(MPC_dealers, MPC_dealers[MAR2020 or AH Release II] = "MAR2020"), [Outlet ID] ),
                         COUNTROWS( FILTER(MPC_dealers, MPC_dealers[MB PC] <> "" && MPC_dealers[MB PC] <> BLANK()) ) )
return IF( conv = BLANK(), 0, conv )

var bizUnit = max(MPC_dealers_offering[variable])
return COUNTROWS(FILTER(MPC_dealers_offering,
                        CONTAINS('Outlet Function Categories',
                                'Outlet Function Categories'[Function],
                                MPC_dealers_offering[value]) &&
                                MPC_dealers_offering[variable] = bizUnit
                        )
                )
